// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/governance/TimelockController.sol";

/**
 * @title AegisTimelock
 * @dev Revolutionary security feature: Forces a mandatory delay for all upgrades
 * This prevents instant rug pulls and gives token holders time to react
 */
contract AegisTimelock is TimelockController {
    /**
     * @dev Initialize the timelock with security parameters
     * @param minDelay Minimum delay in seconds for operations (recommended: 1-7 days)
     * @param proposers Addresses that can propose operations
     * @param executors Addresses that can execute operations
     * @param admin Admin address (should be a multi-sig or governance contract)
     */
    constructor(
        uint256 minDelay,
        address[] memory proposers,
        address[] memory executors,
        address admin
    ) TimelockController(minDelay, proposers, executors, admin) {}

    /**
     * @dev Get timelock details for transparency
     */
    function getTimelockInfo() public view returns (
        uint256 minDelay,
        uint256 currentTimestamp
    ) {
        return (getMinDelay(), block.timestamp);
    }

    /**
     * @dev Emergency cancel function - only for legitimate emergencies
     */
    function emergencyCancel(bytes32 id) public onlyRole(CANCELLER_ROLE) {
        cancel(id);
    }
}
